import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import LoginPage from './loginpage';

function App() {
  return(
    <Router>
    <Route path="/" exact component={LoginPage}/>
    </Router>
  )

}

export default App;
